                <span className={styles.title}>I Am Available For Freelancer</span>

                <div className="container"><a className="border-animation" href="#">
                    <div className="border-animation__inner">Hire me</div>
                </a></div>
                {/*<button className={styles.btn}>Hire me</button>*/}
            </div>
        </div>
    );
}

